import{_ as e,c as t,o as a,a as p}from"./app.7001bd85.js";const u='{"title":"2021-2022","description":"","frontmatter":{"title":"2021-2022","date":"2022-01-11T01:29:14.000Z","tags":["general"],"author":"dyzdyz010","collection":"Year Review"},"headers":[{"level":3,"title":"\u65B0\u7684\u4E00\u5E74\u6211\u8BB8\u613F\uFF1A","slug":"\u65B0\u7684\u4E00\u5E74\u6211\u8BB8\u613F\uFF1A"}],"relativePath":"posts/life/2021/2021-year-review.md"}',i={},r=p('<p>\u4E0D\u77E5\u4E0D\u89C9\u53C2\u52A0\u5DE5\u4F5C\u5DF2\u7ECF\u5FEB\u516B\u5E74\u4E86\u3002</p><p>\u81EA\u4ECE\u65B0\u51A0\u75AB\u60C5 2020 \u5E74\u521D\u7206\u53D1\u4EE5\u6765\uFF0C\u4E16\u754C\u4E0A\u597D\u591A\u66FE\u7ECF\u4E60\u4EE5\u4E3A\u5E38\u7684\u4E8B\u60C5\u90FD\u6539\u53D8\u4E86\u3002\u4E00\u4E9B\u4ECE\u6765\u4E0D\u600E\u4E48\u7528\u7684\u7269\u54C1\u4E00\u4E0B\u5B50\u6210\u4E86\u751F\u6D3B\u5FC5\u9700\u54C1\uFF1B\u8DE8\u56FD\u7684\u8054\u7CFB\u53D8\u5F97\u56F0\u96BE\u4E86\uFF0C\u5185\u90E8\u77DB\u76FE\u4E5F\u4ECE\u800C\u53D8\u5F97\u51F8\u663E\u4E86\uFF0C\u4E0D\u7BA1\u662F\u53D1\u8FBE\u56FD\u5BB6\u8FD8\u662F\u53D1\u5C55\u4E2D\u56FD\u5BB6\u90FD\u4E00\u89C6\u540C\u4EC1\u3002</p><p>\u5728\u4E0D\u751A\u6FC0\u70C8\u7684\u5185\u90E8\u77DB\u76FE\u548C\u51B2\u7A81\u4E2D\uFF0C\u6211\u4EEC\u8FD9\u4E9B\u5E73\u6C11\u767E\u59D3\u7684\u751F\u6D3B\u8D28\u91CF\u8089\u773C\u53EF\u89C1\u7684\u4E0B\u964D\u3002\u4E0D\u540C\u7FA4\u4F53\u7684\u5272\u88C2\u611F\u8D8A\u6765\u8D8A\u5F3A\uFF0C\u5DEE\u5F02\u548C\u5206\u5316\u6210\u4E86\u4E3B\u65CB\u5F8B\uFF0C\u4EFF\u4F5B\u5927\u5BB6\u90FD\u5931\u53BB\u4E86\u540C\u7406\u5FC3\uFF0C\u56DE\u5230\u4E86\u5F31\u8089\u5F3A\u98DF\u7684\u9ED1\u6697\u65F6\u4EE3\uFF0C\u5C0A\u4E25\u548C\u5EC9\u803B\u90FD\u53D8\u5F97\u4E0D\u518D\u91CD\u8981\u3002\u65F6\u4EE3\u7684\u6D9F\u6F2A\u9010\u6E10\u53D8\u6210\u4E86\u72C2\u4E71\u7684\u6D6A\u6F6E\uFF0C\u666E\u901A\u7684\u6211\u65E0\u529B\u7ACB\u8DB3\u4E8E\u6F6E\u5934\u4E4B\u4E0A\uFF0C\u53EA\u80FD\u968F\u6CE2\u9010\u6D41\uFF0C\u611F\u53D7\u65F6\u4EE3\u7684\u5C18\u57C3\u843D\u5728\u8EAB\u4E0A\u7684\u611F\u89C9\u3002</p><p>\u56DE\u60F3\u8D77\u66FE\u7ECF\u770B\u5230\u7684\u201C\u68C9\u82B1\u7CD6\u5B9E\u9A8C\u201D\uFF0C\u867D\u7136\u53EF\u80FD\u4E0D\u592A\u51C6\u786E\uFF0C\u4F46\u662F\u6211\u7684\u7406\u89E3\u662F\uFF0C\u5EF6\u8FDF\u6EE1\u8DB3\u7684\u52A8\u529B\u662F\u5EFA\u7ACB\u5728\u5B89\u5168\u611F\u4E4B\u4E0A\u7684\u3002\u4EC0\u4E48\u662F\u5EF6\u8FDF\u6EE1\u8DB3\uFF1F\u53EA\u8981\u52AA\u529B\u5C31\u80FD\u51FA\u4EBA\u5934\u5730\u3001\u5C0F\u6709\u6210\u5C31\u751A\u81F3\u5927\u5BCC\u5927\u8D35\uFF1B\u4E00\u5206\u8015\u8018\u4E00\u5206\u6536\u83B7\uFF1B\u53EA\u8981\u6709\u68A6\u60F3\u5C31\u4E00\u5B9A\u80FD\u5B9E\u73B0\u3002\u4EC0\u4E48\u662F\u5B89\u5168\u611F\uFF1F\u7A33\u5B9A\u7684\u5DE5\u4F5C/\u6536\u5165;\u5065\u5168\u7684\u8FFD\u8D23\u5236\u5EA6/\u8D54\u507F\u673A\u5236/\u9884\u9632\u673A\u5236;\u548C\u8C10\u7684\u4EBA\u9645\u793E\u4F1A\u5E26\u6765\u7684\u4EBA\u4E0E\u4EBA\u4E4B\u95F4\u7684\u4FE1\u4EFB\u611F;\u6BB7\u5B9E\u7684\u5BB6\u5883/\u5145\u88D5\u7684\u8D44\u4EA7\u3002\u5728\u66FE\u7ECF\u7684\u4E2D\u56FD\u793E\u4F1A\uFF0C\u4E00\u4E2A\u4EBA\u5931\u53BB\u4E86\u5B89\u5168\u611F\uFF0C\u53EF\u80FD\u53EA\u662F\u5931\u53BB\u5B9E\u73B0\u7406\u60F3\u751F\u6D3B\u7684\u673A\u4F1A\uFF0C\u4E0D\u8FC7\u6CEF\u7136\u4F17\u4EBA\u800C\u5DF2\uFF1B\u5728\u73B0\u5728\u7684\u793E\u4F1A\uFF0C\u5931\u53BB\u5B89\u5168\u611F\uFF0C\u4E5F\u5C31\u5931\u53BB\u4E86\u4E3A\u4EBA\u7684\u5C0A\u4E25\u3002\u968F\u7740\u8D2B\u5BCC\u5DEE\u8DDD\u62C9\u5927\uFF0C\u5404\u7C7B\u8BDD\u8BED\u6743\u4F1A\u8D8A\u6765\u8D8A\u96C6\u4E2D\u5316\uFF0C\u5931\u5229\u7684\u4EBA\u8D8A\u6765\u8D8A\u96BE\u4EE5\u5F97\u5230\u7B2C\u4E8C\u6B21\u673A\u4F1A\uFF0C\u4E0D\u8BBA\u662F\u4ECE\u73B0\u5B9E\u8003\u91CF\u8FD8\u662F\u5E7F\u6CDB\u610F\u8BC6\u4E0A\u3002</p><p>\u6BCF\u5F53\u6211\u770B\u5230\u7F51\u4E0A\u4E00\u4E9B\u5A92\u4F53\u548C\u540D\u4EBA\u5728\u5341\u5206\u660E\u663E\u5730\u8F93\u5165\u4EF7\u503C\u89C2\u65F6\uFF0C\u6211\u5C31\u6709\u4E00\u79CD\u6DF1\u6DF1\u7684\u65E0\u529B\u611F\u2014\u2014\u2014\u65E0\u529B\u6539\u53D8\uFF0C\u4E0D\u60F3\u987A\u4ECE\u3002\u96BE\u9053\u4E16\u754C\u5C31\u65E0\u53EF\u907F\u514D\u5730\u8D70\u5411\u8D62\u5BB6\u901A\u5403\u7684\u5C40\u9762\u4E86\u5417\uFF1F\u8FD8\u662F\u53EA\u6709\u4E2D\u56FD\u5982\u6B64\uFF1F\u7ECF\u6D4E\u80FD\u529B\u8D8A\u6765\u8D8A\u6210\u4E3A\u8861\u91CF\u4E00\u4E2A\u4EBA\u7684\u552F\u4E00\u6807\u51C6\uFF0C\u4E0D\u77E5\u5931\u53BB\u4E86\u60C5\u6000\u7684\u4EBA\u4EEC\u65E5\u540E\u4F1A\u600E\u4E48\u5E94\u5BF9\u5403\u529B\u4E0D\u8BA8\u597D\u3001\u5229\u4ED6\u4E0D\u5229\u5DF1\u7684\u60C5\u5F62\u3002</p><p>\u4F46\u662F\u629B\u5F00\u8FD9\u4E9B\u4E0D\u8C08\uFF0C\u6211\u4ECD\u613F\u610F\u505A\u4E00\u4E2A\u5FC3\u6000\u5E0C\u671B\u7684\u4EBA\u3002\u65E2\u7136\u8FD9\u4E2A\u4E16\u754C\u80FD\u591F\u6B63\u5E38\u8FD0\u8F6C\u4E00\u5929\uFF0C\u90A3\u6211\u6709\u4EC0\u4E48\u7406\u7531\u4E0D\u53BB\u671D\u7740\u68A6\u60F3\u52AA\u529B\u4E00\u5929\u5462\uFF1F</p><p>\u5DE5\u4F5C\u9010\u6E10\u53D8\u5F97\u7A33\u5B9A\u4E0B\u6765\uFF0C\u6709\u4E86\u5145\u88D5\u7684\u4F11\u606F\u65F6\u95F4\uFF0C\u8BA9\u6211\u7EC8\u4E8E\u6709\u4E86\u5FC3\u529B\u548C\u6761\u4EF6\u7814\u7A76\u6E38\u620F\u5F00\u53D1\u548C\u5404\u79CD\u7231\u597D\uFF1B</p><p>\u5165\u4F4F\u4E86\u65B0\u623F\u5B50\uFF0C\u6709\u4E86\u6253\u9020\u6210\u81EA\u5DF1\u559C\u6B22\u7684\u6837\u5B50\u7684\u52A8\u529B\uFF1B</p><p>\u7B2C\u4E00\u6B21\u53BB\u4E86\u4E91\u5357\u6606\u660E\uFF0C\u8DB3\u8FF9\u7248\u56FE\u53C8\u591A\u4E86\u4E00\u5757\uFF1B</p><p>\u5728\u751F\u6D3B\u7684\u57CE\u5E02\u627E\u5230\u4E86\u98CE\u666F\u4F18\u7F8E\u7684\u5730\u65B9\uFF0C\u8BA9\u6211\u7684\u601D\u7EF4\u53C8\u8FDB\u4E00\u6B65\u5F00\u9614\uFF1B</p><p>\u7F16\u7A0B\u6280\u80FD\u4E0D\u65AD\u8FDB\u6B65\uFF0C\u7EC8\u7A76\u8FD8\u662F\u6CA1\u6709\u653E\u5F03\u81EA\u5DF1\u7684\u4E00\u4EFD\u575A\u6301\uFF1B</p><p>\u8BA4\u8BC6\u4E86\u61C2\u6211\u7684\u4EBA\uFF0C\u539F\u6765\u4EBA\u548C\u4EBA\u4E4B\u95F4\u7684\u9ED8\u5951\u662F\u8FD9\u6837\u5947\u5999\u7684\u611F\u89C9\uFF0C\u539F\u6765\u4EBA\u751F\u4E0D\u53EA\u6709\u5B64\u519B\u594B\u6218\u3002</p><h3 id="\u65B0\u7684\u4E00\u5E74\u6211\u8BB8\u613F\uFF1A" tabindex="-1">\u65B0\u7684\u4E00\u5E74\u6211\u8BB8\u613F\uFF1A <a class="header-anchor" href="#\u65B0\u7684\u4E00\u5E74\u6211\u8BB8\u613F\uFF1A" aria-hidden="true">#</a></h3><ol><li>\u953B\u70BC\u8EAB\u4F53\uFF0C\u597D\u7684\u8EAB\u4F53\u624D\u80FD\u5EF6\u4F38\u4E3A\u68A6\u60F3\u52AA\u529B\u7684\u957F\u5EA6</li><li>\u65B0\u51A0\u75AB\u60C5\u5C3D\u5FEB\u7ED3\u675F\uFF0C\u8BA9\u4E16\u754C\u518D\u6B21\u7D27\u5BC6\u8054\u7CFB\u8D77\u6765</li><li>\u7EE7\u7EED\u671D\u7740\u68A6\u60F3\u52AA\u529B\uFF0C\u81F3\u5C11\u4E0D\u80FD\u539F\u5730\u8E0F\u6B65</li><li>\u521B\u9020\u66F4\u591A\u7684\u7F8E\u597D\u56DE\u5FC6</li></ol>',14),l=[r];function o(_,s,c,n,d,h){return a(),t("div",null,l)}var v=e(i,[["render",o]]);export{u as __pageData,v as default};
